interface StacksActivity {
  query: any;
  pendingTxs: MempoolTokenTransferTransaction[];
  confirmedTxs: Transaction[];
}

function useGetStacksActivityByAddresses(addresses: string[]): StacksActivity {
  const { query, pendingTxs, confirmedTxs } = useStacksActivityQueries(addresses);

  if (!addresses || addresses.length === 0)
    return { query: undefined, pendingTxs: [], confirmedTxs: [] };

  return {
    query,
    pendingTxs,
    confirmedTxs,
  };
}

